import React, { useState } from "react";
import Layout from "../../Layout";
import Main from "../../Main";

import data from "./data";

const Users = () => {
  const [inhabitants, setInhabitants] = useState(data);

  const addInhabitants = () => {
    setInhabitants([
      {
        id: 234,
        name: "Twizzle Switchbooster",
        thumbnail:
          "http://www.publicdomainpictures.net/pictures/20000/nahled/scarlet-macaw.jpg",
        age: 261,
        weight: 42.610516,
        height: 115.931244,
        hair_color: "Green",
        professions: ["Woodcarver", "Baker", "Metalworker", "Gemcutter"],
        friends: ["Whitwright Quickpower"],
      },
      ...inhabitants,
    ]);
  };

  return (
    <Layout id={15}>
      <Main>
        <h1>Users</h1>

        <button onClick={addInhabitants}>Agregar</button>

        <table className="table">
          <thead>
            <tr>
              <th>Nombre</th>
            </tr>
          </thead>
          <tbody>
            {inhabitants.map((inhabitant) => {
              return (
                <tr>
                  <td>{inhabitant.name}</td>
                </tr>
              );
            })}
          </tbody>
        </table>
      </Main>
    </Layout>
  );
};

export { Users };
